import React from "react";

export const HomeScreen = ({data}) => {

  return (
    <div>
      <header>
        <a href="/">Home</a>
      </header>
      <div>
        <h1>Inmuebles Disponibles</h1>

        <div className="products">

        {
          data.inmueble.map(inmueble => (<div className="product" key={inmueble.slug}>

          <img src={inmueble.image} alt={inmueble.name} />
          <p>
            {inmueble.name}
          </p>
          <p>
            {inmueble.price}
          </p>

          </div>))
        }

        </div>
        </div>
    </div>
  )
}


export default HomeScreen;
